import React from 'react'
import './Sidebar.css'
import SidebarContents from './SidebarContents'
import HomeIcon from '@material-ui/icons/Home';
import ScheduleIcon from '@material-ui/icons/Schedule';
import FavoriteIcon from '@material-ui/icons/Favorite';
import AlbumIcon from '@material-ui/icons/Album';
import LibraryMusicIcon from '@material-ui/icons/LibraryMusic';
import SearchIcon from '@material-ui/icons/Search';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
import { Router,Link, Switch } from 'react-router-dom';
import { createBrowserHistory } from "history";

const history = createBrowserHistory();


function Sidebar() {
    return (
        <>
        <Router history={history}>
        <Switch>
         <div className='Sidebar-container'>
         <img alt="timer" className='Img-logo' src='../images/logo.png' />
         <SidebarContents  name='HOME' icon={<HomeIcon/>}/>
         <SidebarContents name='BROWSE' icon={<SearchIcon/>} />
         <p className='Sidebar-heading'>YOUR LIBRARY</p>
         <SidebarContents name='RECENTLY PLAYED' icon={<ScheduleIcon/>} />
         <button onClick={() => this.nextPath('/allsong') }>
         <SidebarContents name='ALL SONGS'  icon={<LibraryMusicIcon/>}/> 
         </button>
         <button onClick={() => this.nextPath('/favorite') }>
         <SidebarContents name='FAVORITE SONGS' icon={<FavoriteIcon/>}/>
         </button>
         <button onClick={() => this.nextPath('/album') }>
         <SidebarContents  name='ALBUMS' icon={<AlbumIcon/>}/>
         </button>


         <p className='Sidebar-heading'>PLAYLIST</p>
         <div>

         <a href='' className='btn btn-playlist'> <AddCircleOutlineIcon/> CREATE PLAYLIST</a>
         </div>
         </div>   
         </Switch>
         </Router>
        </>
    )
}

export default Sidebar
